func weightedUniformStrings(s: String, queries: [Int]) -> [String] {
    // Write your code here
    
    let letters = NSArray(array: ["a", "b", "c", "d", "e", "f", "g", "h", "i", "j", "k", "l", "m", "n", "o", "p", "q", "r", "s", "t", "u", "v", "w", "x", "y", "z"])
    
    let stringList = Array(s)
    var stringWeights:[Int] = [Int]()

    var rawValue:String?
    var count = 0
    for i in 0..<s.count {
        let valueString = "\(stringList[i])"
        let weightValue = letters.index(of: valueString) + 1

        if (rawValue == nil) {
            count = weightValue
            rawValue = valueString
        }else {
            if (valueString == rawValue) {
                count += weightValue
            }else {
                count = weightValue
                rawValue = valueString
            }
        }
        stringWeights.append(count)
    }
    
    
    var stringmatchs:[String] = [String]()
    for value in queries {
        if (stringWeights.contains(value)) {
            stringmatchs.append("Yes")
        }else {
            stringmatchs.append("No")
        }
    }
    return stringmatchs
}


